import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';

function Header() {
    return (
        <header className="bg-zinc-700 text-white p-4 shadow-md">
            <div className="container mx-auto flex justify-between items-center">
                <div className="flex items-center">
                    {/* Placeholder for a logo if you have one */}
                    <div className="my-1 mr-6">
                    <h1 className="font-extrabold text-2xl text-left">Kittler</h1>
                    <h2 className="italic text-left">switch off all apparatuses.</h2>
                    </div>
                </div>
                <nav className="flex items-center">
                    <Link to="/" className="inline-block p-2 font-bold hover:text-slate-400 transition-colors duration-300">Home</Link>
                    {/* Sign In and Register Buttons */}
                    <Link to="/login" className="inline-block p-2 ml-4 bg-stone-400 text-white hover:bg-neutral-300 transition-colors duration-300 font-semibold rounded">Login</Link>
                    <Link to="/signup" className="inline-block p-2 ml-4 bg-stone-500 hover:bg-blue-600 transition-colors duration-300 font-semibold rounded">Register</Link>
                </nav>
            </div>
        </header>
    );
}

export default Header;
